import './style.scss';
import React from 'react';

export class Menu extends React.Component {
	constructor(props) {
		super(props);
	}
	home(){
        window.location.pathname ="/";    
    }

	render() {
		return (
			<div class="sidebar">
  <a class="active" href="#home">Home</a>
  <a href="#news">News</a>
  <a href="#contact">Contact</a>
  <a href="#about">About</a>
</div>
		);
	}
}
